- input: TEXT,F3X,,"Line 1 and Line 5 of Schedule I discrepancies are accounted for
    by the normal non-itemized transactions incurred by our committee. The line 15
    entry for Eric Caron is related to transaction ID 100CAR47903 and was originally
    reported on line 21b. Several of the Riggs Bank entries have been reclassified
    to line 17. The remaining line 15 entry for Riggs Bank is related to tranasaction
    ID 100RIG10305RIG1 and was originally reported on line 21b. The line 15 transactions
    for Abdon and Markwell Research are refunds of operating expenses that although
    listed on H4 as sharable expenses were never transfered and thus were paid with
    federal funds."
